    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
            margin: 0;
            padding: 20px;
            background-color: #f5f5f5;
        }
        .container {
            width: 95%;
            max-width: 900px;
            text-align: center;
        }
        h1 {
            color: #333;
            margin-bottom: 30px;
            font-size: 2.5rem;
        }
        .input-container {
            margin-bottom: 30px;
        }
        #codeInput {
            width: 100%;
            padding: 20px;
            font-size: 24px;
            border: 2px solid #ddd;
            border-radius: 5px;
            text-align: center;
        }
        #resultContainer {
            background-color: white;
            border-radius: 10px;
            padding: 20px;
            width: 100%;
            box-shadow: 0 3px 15px rgba(0, 0, 0, 0.1);
            display: none;
        }
        .error {
            color: red;
            margin-top: 15px;
            font-size: 20px;
            display: none;
        }
        .parsed-info {
            text-align: left;
            margin-bottom: 20px;
            padding: 15px;
            background-color: #f2f2f2;
            border-radius: 5px;
        }
        .results-grid {
            display: flex;
            flex-direction: column;
            gap: 20px;
        }
        .result-card {
            background-color: white;
            border-radius: 10px;
            padding: 20px;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
            display: flex;
            flex-direction: column;
            transition: all 0.3s ease;
        }
        .primary-info {
            display: flex;
            justify-content: space-between;
            margin-bottom: 15px;
        }
        .info-box {
            text-align: center;
        }
        .info-box.primary {
            flex: 1;
            padding: 15px;
            background-color: #f0f8ff;
            border-radius: 8px;
            margin: 0 5px;
        }
        .info-box.secondary {
            flex: 1;
            padding: 10px;
            background-color: #f9f9f9;
            border-radius: 5px;
            margin: 0 5px;
        }
        .info-box.tertiary {
            flex: 1;
            padding: 8px;
            background-color: #f2f2f2;
            border-radius: 5px;
            margin: 0 5px;
        }
        .info-label {
            font-size: 14px;
            color: #666;
            margin-bottom: 5px;
        }
        .info-value.primary {
            font-size: 32px;
            font-weight: bold;
            color: #000;
        }
        .info-value.secondary {
            font-size: 24px;
            font-weight: bold;
            color: #333;
        }
        .info-value.tertiary {
            font-size: 16px;
            color: #555;
        }
        .no-results {
            text-align: center;
            padding: 30px;
            font-size: 20px;
            color: #666;
        }
        .secondary-info {
            display: flex;
            justify-content: space-between;
        }
        .tertiary-info {
            display: flex;
            justify-content: space-between;
            margin-top: 15px;
        }
    </style>
</head>

        // Set up the input listener when the page loads
        document.addEventListener('DOMContentLoaded', function() {
            const codeInput = document.getElementById('codeInput');
            codeInput.addEventListener('keydown', function(event) {
                if (event.key === 'Enter') {
                    processCode(this.value);
                }
            });
            codeInput.addEventListener('input', function(event) {
                if (this.value.length === 27) {
                    processCode(this.value);
                }
            });
        });

        function processCode(code) {
            document.getElementById('codeInput').value = "";
            const errorElement = document.getElementById('error');
            const resultContainer = document.getElementById('resultContainer');
            const resultsElement = document.getElementById('results');

            // Clear previous results
            resultsElement.innerHTML = '';

            // Validate and parse the code
            if (code.length !== 27) {
                errorElement.textContent = 'O código deve ter 27 caracteres.';
                errorElement.style.display = 'block';
                resultContainer.style.display = 'none';
                return;
            }

            // Parse the code
            const idStart = code.substring(0, 2);
            const expirationDate = code.substring(2, 8);
            const idMiddle = code.substring(8, 10);
            const lot = code.substring(10, 16);
            const idEnd = code.substring(16, 18);
            const sku = code.substring(18).replace(/^0/, '');

            // Format date from YYMMDD to DD/MM/YY
            const year = expirationDate.substring(0, 2);
            const month = expirationDate.substring(2, 4);
            const day = expirationDate.substring(4, 6);
            const formattedDate = `${day}/${month}/${year}`;

            // Create SKU-LOT string for search
            const skuLot = `${sku}-${lot}`;

            // Search for the SKU-LOT in the JSON data
            let found = false;

            // Search in all loaded JSON data
            for (const fileName in jsonData) {
                const fileData = jsonData[fileName];
                
                for (const item of fileData) {
                    if (item['SKU-LOT'] === skuLot) {
                        found = true;
                        
                        // Create a card for each match
                        const card = document.createElement('div');
                        card.className = 'result-card';
                        
                        // Primary info (NF and Remessa)
                        const primaryInfo = document.createElement('div');
                        primaryInfo.className = 'primary-info';
                        
                        const nfBox = document.createElement('div');
                        nfBox.className = 'info-box primary';
                        nfBox.innerHTML = `
                            <div class="info-label">NF</div>
                            <div class="info-value primary">${item.NF || '-'}</div>
                        `;
                        
                        const remessaBox = document.createElement('div');
                        remessaBox.className = 'info-box primary';
                        remessaBox.innerHTML = `
                            <div class="info-label">REMESSA</div>
                            <div class="info-value primary">${item.Remessa || '-'}</div>
                        `;
                        
                        primaryInfo.appendChild(nfBox);
                        primaryInfo.appendChild(remessaBox);
                        
                        // Secondary info (Caixas)
                        const secondaryInfo = document.createElement('div');
                        secondaryInfo.className = 'secondary-info';
                        
                        const caixasBox = document.createElement('div');
                        caixasBox.className = 'info-box secondary';
                        caixasBox.innerHTML = `
                            <div class="info-label">CAIXAS</div>
                            <div class="info-value secondary">${item.Caixas || '-'}</div>
                        `;
                        
                        secondaryInfo.appendChild(caixasBox);
                        
                        // Tertiary info (SKU and Lote)
                        const tertiaryInfo = document.createElement('div');
                        tertiaryInfo.className = 'tertiary-info';
                        
                        const skuBox = document.createElement('div');
                        skuBox.className = 'info-box tertiary';
                        skuBox.innerHTML = `
                            <div class="info-label">SKU</div>
                            <div class="info-value tertiary">${item.SKU || '-'}</div>
                        `;
                        
                        const loteBox = document.createElement('div');
                        loteBox.className = 'info-box tertiary';
                        loteBox.innerHTML = `
                            <div class="info-label">LOTE</div>
                            <div class="info-value tertiary">${item.Lote || '-'}</div>
                        `;
                        
                        tertiaryInfo.appendChild(skuBox);
                        tertiaryInfo.appendChild(loteBox);
                        
                        // Append all sections to the card
                        card.appendChild(primaryInfo);
                        card.appendChild(secondaryInfo);
                        card.appendChild(tertiaryInfo);
                        
                        // Add the card to results
                        resultsElement.appendChild(card);
                    }
                }
            }

            if (!found) {
                // Create a message for no results
                const noResults = document.createElement('div');
                noResults.className = 'no-results';
                noResults.textContent = 'Nenhum resultado encontrado para este SKU-Lote.';
                resultsElement.appendChild(noResults);
            }

            // Show the results
            errorElement.style.display = 'none';
            resultContainer.style.display = 'block';
        }
    </script>
